import React from 'react';

function Playlist({ songs, onSelectSong }) {
  return (
    <div className="playlist">
      <h3>Playlist</h3>
      <ul>
        {songs.map((song, index) => (
          <li key={index} onClick={() => onSelectSong(index)}>
            {song.title}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Playlist;
